import React from 'react'

const Online = ({users}) => {
    return (
        <>
            { users.map((data)=> (
                data.userId &&
            <div className="onlineFriendContainer">
                <div className="onlineUsers">
                    <div className="onlineSign"></div>
                    <img src= { data.profile } alt="" className="onlineUserImage" />
                    <p className="onlineUserName">{data.user}</p>
                </div>
            </div>
            ))}
        </>
    )
}

export default Online
